    chars = {}
    left = 0
    max_length = 0
    for right in range(len(s)):
        if s[right] in chars:
            left = max(chars[s[right]] + 1, left)
        chars[s[right]] = right
        max_length = max(max_length, right - left + 1)
    return max_length

